/** @jsxImportSource theme-ui */
// import { Grid, Label, Box, Input, Textarea, Button, Flex, Image } from "theme-ui";
import React from "react";
import Headline from '../components/Headline';
import axios from 'axios';
import { useState, useEffect } from 'react';
import SingleCard from '../components/PreviewCards/SingleCard';
import { useLocation } from "react-router-dom";

import { Flex, Image, Text, Box } from 'theme-ui';
import { CircleWavyCheck } from 'phosphor-react';
import { Link } from "react-router-dom";



const CardLayout = (props) => (<Flex {...props} sx={{ width: ['300px','400px','340px','360px'], height: '400px', borderRadius: '40px', flexDirection: 'column', pb: '30px', overflow: 'hidden', backgroundColor: 'navy40' }}>{props.children}</Flex>)

const CardBackground = ({background, ...props}) => (<Image src={background} sx={{ maxWidth: ['300px','400px','340px','360px'], maxHeight: '200px', height: '200px', minHeight: '240px', width: '100%', objectFit: 'cover', borderRadius: '40px' }} />)

const PrimaryImage = ({primary, ...props}) => (<Flex sx={{alignSelf: 'center', position: 'relative', mt: '-65px', backgroundColor: '#0508104D', borderRadius: '50%', padding: '6px'}}><Image src={primary} sx={{ maxWidth: '110px', maxHeight: '110px', objectFit: 'cover', borderRadius: '50%' }} /></Flex>)

const TextContainer = (props) => (<Flex {...props} sx={{ justifyContent: 'center', alignItems: 'center', flexDirection: 'column', pt: '10px' }}>{props.children}</Flex>)

const Reviews = (props) => {
    const location = useLocation();
    const StateData = location.state
    const [filteredReviews, setFilteredReviews] = useState([]);

    console.log(StateData);

    return (
        <CardLayout>
        <CardBackground background={CardsData.background} />
        <Flex sx={{ width: '100%', flexDirection: ['column', null, null, 'row'], mb: '50px' }}>
            <Flex sx={{ width: '100%', alignItems: 'center', justifyContent: 'center' }}>
                <PrimaryImage primary={CardsData.primary} />
                <TextContainer>
                    <Headline sx={{ pb: '10px', textAlign: 'start', fontSize: 4, fontWeight: '600' }}>{CardsData.projectName}</Headline>
                    <Flex sx={{ justifyContent: 'center', alignItems: 'center' }}>
                        <Text sx={{ color: 'navy0', pr: '2px', fontSize: 2, fontWeight: '600', textAlign: 'center' }}>by {CardsData.creatorName}</Text>
                        <CircleWavyCheck size={20} sx={{ color: 'navy0' }} />
                    </Flex>
                </TextContainer>
            </Flex>
            <Grid sx={{ gridTemplateColumns: ['1fr 1fr', '1fr 1fr 1fr'], width: ['90%', null, null, '100%'], pt: ['20px', null, null, '0px'], justifySelf: ['center', null, null, 'end'], alignSelf: 'center' }}>
                <Flex sx={{ flexDirection: 'column', justifyContent: 'center'}}>
                    <Text sx={{ fontSize: 4, fontWeight: '700', textAlign: ['center', null, null, 'start'] }}>
                        {totalSupply ? totalSupply : "Loading..."}
                    </Text>
                    <Text sx={{ fontSize: 2, color: 'gray50', textAlign: ['center', null, null, 'start'] }}>
                        Total Supply
                    </Text>
                </Flex>

                {/* <Flex sx={{ flexDirection: 'column' }}>
                    <Text sx={{ fontSize: 4, fontWeight: '700', textAlign: ['center', null, null, 'start'] }}>
                        6.4k
                    </Text>
                    <Text sx={{ fontSize: 2, color: 'gray50', textAlign: ['center', null, null, 'start'] }}>
                        Total Holders
                    </Text>
                </Flex>

                <Flex sx={{ flexDirection: 'column' }}>
                    <Text sx={{ fontSize: 4, fontWeight: '700', textAlign: ['center', null, null, 'start'] }}>
                        644.1k
                    </Text>
                    <Text sx={{ fontSize: 2, color: 'gray50', textAlign: ['center', null, null, 'start'] }}>
                        Total Volume
                    </Text>
                </Flex> */}

                <Flex sx={{ flexDirection: 'column', justifyContent: 'center' }}>
                    <Text sx={{ fontSize: 4, fontWeight: '700', textAlign: ['center', null, null, 'start'] }}>
                        Ξ {responseData ? (responseData && responseData.price && responseData.price.totalNative) : "Loading..."}
                    </Text>
                    <Text sx={{ fontSize: 2, color: 'gray50', textAlign: ['center', null, null, 'start'] }}>
                        Floor Price
                    </Text>
                </Flex>

                <Link sx={{
                        borderRadius: '100px',

                        background: 'linear-gradient(95.41deg, #3B5AD5 0%, #2745C3 100%)',
                        minWidth: '40px',
                        justifyContent: 'center',
                        alignItems: 'center',
                        alignSelf: 'center',
                        justifySelf: 'center',
                        textDecoration: 'none', 
                        color: 'inherit'
                    }} to={`/createReview/${CardsData.projectHref}`} state={{projectName: CardsData.projectName, background: CardsData.background, primary: CardsData.primary, creatorName: CardsData.creatorName, projectHref: CardsData.projectHref, contractAddress: CardsData.contractAddress}} {...CardsData} >
                    <Box sx={{
                        borderRadius: '100px',
                        px: '24px',
                        py: '10px',
                        background: 'linear-gradient(95.41deg, #3B5AD5 0%, #2745C3 100%)',
                        minWidth: '40px',
                        justifyContent: 'center',
                        alignItems: 'center',
                        alignSelf: 'center',
                        justifySelf: 'center'
                    }}>
                        <Text sx={{fontWeight: '700', whiteSpace: 'nowrap'}}>Write Review</Text>
                    </Box>
                </Link>
            </Grid>
        </Flex>

        <Box>
            {reviews.map(
                review => (
                    <ReviewBoxes 
                    rating={review.rating}
                    body={review.body}
                    author={review.author}
                    projectName={review.projectName}
                    />
                )
            )}
        </Box>
    </CardLayout>
    );
};

export default Reviews;
